import React from "react"

export default function Nav(){
   const crte = '//';
   

   return (
      <ul className="nav__links nesto">
         <li className="razmak"><a href="pocetak" ><span>{crte}</span>  Pocetna</a></li>
         <li className="razmak"><a href="pocetak" ><span>{crte}</span>  O nama</a></li>
         <li className="razmak"><a href="pocetak" ><span>{crte}</span>  Usluge</a></li>
         <li className="razmak"><a href="pocetak"><span>{crte}</span>  Vrste kame</a></li>
         <li className="razmak"><a href="pocetak"><span>{crte}</span>  Kontakt</a></li>
      </ul>  
   )
}
